import Navbar from "./Navbar";
import Search from "./Search";

const Header = () => (
  <div className="container-fluid header">
    <div className="row">
      <div className="col-8 container-fluid px-0">
        <img src="/logo.png" alt="Logo" />
        <h1 className="flex-grow-1">Indiana General Assembly</h1>
        <h3>2020 Session</h3>
      </div>
      <div className="col-8">
        <Navbar/>
      </div>
      <div className="col">
        <Search/>
      </div>
    </div>

    <style jsx>{`
      .header {
        background-color: rgb(255, 255, 255);
      }
    `}</style>
  </div>
);

export default Header;
